EMOJI = re.compile(EMOJI_RAW)


def _emoji_df_path() -> str:
    from os.path import join

    return join(adv.__path__[0], "pkg_data", "emoji_df.parquet")


def _emoji_entries(emoji):
    emoji_df = pd.read_parquet(
        _emoji_df_path(),
        columns=["emoji", "name", "group", "sub_group"],
        filters=[("emoji", "in", set(emoji))],
    )
    entries = {record["emoji"]: record for record in emoji_df.to_dict("records")}
    return entries


def extract_emoji(text_list):
    """Return a summary dictionary about emoji in ``text_list``

    Get a summary of the number of emoji, their frequency, the top
    ones, and more.

    :param list text_list: A list of text strings.
    :returns summary: A dictionary with various stats about emoji

    >>> posts = [
    ...     "I am grinning üòÄ",
    ...     "A grinning cat üò∫",
    ...     "hello! üòÄüòÄüòÄ üíõüíõ",
    ...     "Just text",
    ... ]

    >>> emoji_summary = extract_emoji(posts)
    >>> emoji_summary.keys()
    dict_keys(['emoji', 'emoji_text', 'emoji_flat', 'emoji_flat_text',
    'emoji_counts', 'emoji_freq', 'top_emoji', 'top_emoji_text',
    'top_emoji_groups', 'top_emoji_sub_groups', 'overview'])


    >>> emoji_summary["emoji"]
    [['üòÄ'], ['üò∫'], ['üòÄ', 'üòÄ', 'üòÄ', 'üíõ', 'üíõ'], []]

    >>> emoji_summary["emoji_text"]
    [['grinning face'], ['grinning cat'], ['grinning face', 'grinning face',
      'grinning face', 'yellow heart', 'yellow heart'], []]

    A simple extract of emoji from each of the posts. An empty
    list if none exist

    >>> emoji_summary["emoji_flat"]
    ['üòÄ', 'üò∫', 'üòÄ', 'üòÄ', 'üòÄ', 'üíõ', 'üíõ']

    >>> emoji_summary["emoji_flat_text"]
    ['grinning face', 'grinning cat', 'grinning face', 'grinning face',
    'grinning face', 'yellow heart', 'yellow heart']

    All emoji in one flat list.

    >>> emoji_summary["emoji_counts"]
    [1, 1, 5, 0]

    The count of emoji per post.

    >>> emoji_summary["emoji_freq"]
    [(0, 1), (1, 2), (5, 1)]

    Shows how many posts had 0, 1, 2, 3, etc. emoji
    (number_of_emoji, count)

    >>> emoji_summary["top_emoji"]
    [('üòÄ', 4), ('üíõ', 2), ('üò∫', 1)]

    >>> emoji_summary["top_emoji_text"]
    [('grinning face', 4), ('yellow heart', 2),
     ('grinning cat', 1)]

    >>> emoji_summary["top_emoji_groups"]
    [('Smileys & Emotion', 7)]

    >>> emoji_summary["top_emoji_sub_groups"]
    [('face-smiling', 4), ('emotion', 2), ('cat-face', 1)]

    >>> emoji_summary["overview"]
    {'num_posts': 4,
     'num_emoji': 7,
     'emoji_per_post': 1.75,
     'unique_emoji': 3}
    """
    emoji = [re.findall(EMOJI, text.lower()) for text in text_list]
    emoji_flat = [item for sublist in emoji for item in sublist]
    emoji_entries = _emoji_entries(emoji_flat)
    emoji_flat_text = [emoji_entries[em]["name"] for em in emoji_flat]
    emoji_groups = [emoji_entries[em]["group"] for em in emoji_flat]
    emoji_sub_groups = [emoji_entries[em]["sub_group"] for em in emoji_flat]
    summary = {
        "emoji": emoji,
        "emoji_text": [
            [emoji_entries[em]["name"] for em in em_list] for em_list in emoji
        ],
        "emoji_flat": emoji_flat,
        "emoji_flat_text": emoji_flat_text,
        "emoji_counts": [len(em) for em in emoji],
        "emoji_freq": sorted(
            Counter([len(em) for em in emoji]).items(), key=lambda x: x[0]
        ),
        "top_emoji": sorted(
            Counter(emoji_flat).items(), key=lambda x: x[1], reverse=True
        ),
        "top_emoji_text": sorted(
            Counter(emoji_flat_text).items(), key=lambda x: x[1], reverse=True
        ),
        "top_emoji_groups": sorted(
            Counter(emoji_groups).items(), key=lambda x: x[1], reverse=True
        ),
        "top_emoji_sub_groups": sorted(
            Counter(emoji_sub_groups).items(), key=lambda x: x[1], reverse=True
        ),
        "overview": {
            "num_posts": len(text_list),
            "num_emoji": len(emoji_flat),
            "emoji_per_post": len(emoji_flat) / len(text_list),
            "unique_emoji": len(set(emoji_flat)),
        },
    }
    return summary


def emoji_search(regex):
    """Return a DataFrame of all emoji entries that match :attr:`regex`.

    The search is run on the name of the emoji, its group, and sub-group.

    :param str regex: regular expression (case insensitive)

    >>> import advertools as adv
    >>> adv.emoji_search("dog")
              codepoint           status  emoji          name             group        sub_group
    0             1F436  fully-qualified     üê∂      dog face  Animals & Nature    animal-mammal
    1             1F415  fully-qualified     üêï           dog  Animals & Nature    animal-mammal
    2             1F9AE  fully-qualified     ü¶Æ     guide dog  Animals & Nature    animal-mammal
    3  1F415 200D 1F9BA  fully-qualified     üêï‚Äçü¶∫   service dog  Animals & Nature    animal-mammal
    4             1F32D  fully-qualified     üå≠       hot dog      Food & Drink    food-prepared

    >>> blue = adv.emoji_search("blue")
    >>> blue
      codepoint           status emoji                name               group     sub_group
    0     1F499  fully-qualified     üíô          blue heart  Smileys & Emotion       emotion
    1     1FAD0  fully-qualified     ü´ê         blueberries       Food & Drink    food-fruit
    2     1F4D8  fully-qualified     üìò           blue book            Objects    book-paper
    3     1F535  fully-qualified     üîµ         blue circle            Symbols     geometric
    4     1F7E6  fully-qualified     üü¶         blue square            Symbols     geometric
    5     1F537  fully-qualified     üî∑  large blue diamond            Symbols     geometric
    6     1F539  fully-qualified     üîπ  small blue diamond            Symbols     geometric
    """
    emoji_df = pd.read_parquet(_emoji_df_path())
    result_index = (
        emoji_df.select_dtypes("object")
        .apply(lambda series: series.astype(str).str.contains(regex, case=False))
        .apply(lambda row: any(row), axis=1)
    )
    return emoji_df[result_index].reset_index(drop=True)


def emoji_df():
    df = pd.read_parquet(_emoji_df_path())
    return df
